import { useState, useEffect} from "react";
import "./index.css";

const Header = () => {
    const [connected, setConnected] = useState(false);

    const handleMetamask = () =>{
        if(connected){
            //dissconnect from metamask from contract model
            setConnected(false)
        }
        else{
            //connect to metamask from contract model
            setConnected(true)
        }
    }

    useEffect(() => {}, [connected]);

    return(
        <div className="header">
        <a className="menuLink">Home</a><a className="menuLink">My Nfts</a>
        <button className="MetamaskBtn"><img src="../UI/Button1.png"/></button>
        </div> 
    );
}

export default Header;
